You stumbled upon this old album full of landscape photography... Where and when were these photos taken? Who took them? Why do some of them have an otherworldly ambience? Flip through its pages and find it out for yourself.

Features:
1) Hue;
2) Number of Birds;
3) Number of Mountain Ranges.

